package Labs.LabExercise_12;public class Employee {    int empid;    String name;    double basicSal;    public Employee(){     empid=0;     name="zyz";     basicSal=2000;    }    public Employee(int empid,String name,int basicSal){        this.empid=empid;        this.name=name;        this.basicSal=basicSal;    }    public double netSalary(){        double pf=0.14*basicSal;        return pf-basicSal;    }    @Override    public String toString() {        return "Employee Name "+name+"\nEmployee Id"+empid+"\nBasic salary"+basicSal;    }}